import React, { useEffect, useState } from "react";

const Register = () => {
  const [data, setdata] = useState({
    email: "",
    password: "",
    fullname: "",
    dateOfBirth: "",
    gender: "",
    country: [],
    recieveNewsLetters: "",
  });

  const [countries,setcountries] = useState([
    'India','USA','UK','Nepal','Bhutan'
  ])

  const mycountry = countries.map((country,index)=>{
    return <option key={index} value='country'>{country}</option>
  })
  useEffect(() => {
    document.title = "Register Ecommerce";
  }, []);
  return (
    <div className="row">
      <div className="col-lg-6 col-lg-7">
        <div className="card">
          <div className="card-header border-bottom border-primary ">
            <h2
              className="text-center text-primary"
              style={{ fontSize: "40px" }}
            >
              Register Yourself
            </h2>
          </div>
          <div className="card-body border-bottom border-success">
            {/* Email start */}
            <div className="form-group form-row">
              <label htmlFor="" className="col-lg-4">
                E-Mail
              </label>
              {/* do this */}
              {/* <input type="text" name="email" onChange={(e)=>{setdata({...data,email:e.target.value})}} value={data.email} className='form-control' id="" /> */}

              {/* or this */}
              <div className="col-lg-6">
                <input
                  type="text"
                  id=""
                  className="form-control"
                  value={data.email}
                  name="email"
                  onChange={(e) => {
                    setdata({ ...data, [e.target.value]: e.target.value });
                  }}
                />
              </div>
            </div>

            {/* Email end */}
            {/* password end */}
            <div className="form-group form-row">
              <label htmlFor="" className="col-lg-4">
                Password
              </label>
              {/* do this */}
              {/* <input type="text" name="password" onChange={(e)=>{setdata({...data,password:e.target.value})}} value={data.password} className='form-control' id="" /> */}

              {/* or this */}
              <div className="col-lg-6">
                <input
                  type="text"
                  id=""
                  className="form-control"
                  value={data.password}
                  name="password"
                  onChange={(e) => {
                    setdata({ ...data, [e.target.value]: e.target.value });
                  }}
                />
              </div>
            </div>

            {/* password end */}
            {/* fullname start */}

            <div className="form-group form-row">
              <label htmlFor="" className="col-lg-4">
                Full-Name
              </label>
              {/* do this */}

              <div className="col-lg-6">
                {/* <input
                  type="text"
                  name="fullname"
                  onChange={(e) => {
                    setdata({ ...data, fullname: e.target.value });
                  }}
                  value={data.fullname}
                  className="form-control"
                  id=""
                /> */}

                <input
                  type="text"
                  id=""
                  className="form-control"
                  value={data.fullname}
                  name="fullname"
                  onChange={(e) => {
                    setdata({ ...data, [e.target.name]: e.target.value });
                  }}
                />
              </div>
            </div>

            {/* fullname end */}

            {/* dateOfBirth start */}

            <div className="form-group form-row">
              <label htmlFor="" className="col-lg-4">
                Date of birth
              </label>
              {/* do this */}
              {/* <input type="text" name="dateOfBirth" onChange={(e)=>{setdata({...data,dateOfBirth:e.target.value})}} value={data.dateOfBirth} className='form-control' id="" /> */}

              {/* or this */}
              <div className="col-lg-6">
                <input
                  type="date"
                  id=""
                  className="form-control"
                  value={data.dateOfBirth}
                  name="dateOfBirth"
                  onChange={(e) => {
                    setdata({ ...data, [e.target.name]: e.target.value });
                  }}
                />
              </div>
            </div>

            {/* dateOfBirth end */}
            {/* gender start */}

            <div className="form-group form-row">
              <label htmlFor="" className="col-lg-4">
                Gender
              </label>
              <div className="form-check">
                <input
                  type="radio"
                  name="gender"
                  id="male"
                  className="form-check-input"
                  value = 'male'
                  checked = {data.gender === 'male'?true:false}
                  onChange={(e) => {setdata({ ...data, [e.target.name]: e.target.value })
                  }}
                />
                <label htmlFor="male" className="form-check-inline">Male</label>
              </div>
              <div className="form-check">
                <input
                  type="radio"
                  name="gender"
                  id="female"
                  className="form-check-input"
                  value = 'female'
                  checked = {data.gender === 'female'?true:false}
                  onChange={(e) => {setdata({ ...data, [e.target.name]: e.target.value })
                  }}
                />
                <label htmlFor="female" className="form-check-inline">Female</label>
              </div>
              {/* do this */}
              {/* <input type="text" name="gender" onChange={(e)=>{setdata({...data,gender:e.target.value})}} value={data.gender} className='form-control' id="" /> */}

              {/* or this */}
            </div>

            {/* gender end */}
{/* country */}
            <div className="form-group form-row">
              <label htmlFor="" className="col-lg-4">
                Country
              </label>
              {/* do this */}
              {/* <input type="text" name="dateOfBirth" onChange={(e)=>{setdata({...data,dateOfBirth:e.target.value})}} value={data.dateOfBirth} className='form-control' id="" /> */}

              {/* or this */}
              <div className="col-lg-6">
                <select type='text' name='country' className="form-control" 
                value={data.country}
                onChange={(e)=>{setdata({...data,[e.target.name]:e.target.value})}} 
                id=''>
                  {mycountry}
                </select>
              </div>
            </div>

            {/* country end */}
         
{/* newsletter start */}


<div className="form-group form-row">
              <label htmlFor="newsletter" className="col-lg-4">
                Newsletter
              </label>
              {/* do this */}
              {/* <input type="text" name="dateOfBirth" onChange={(e)=>{setdata({...data,dateOfBirth:e.target.value})}} value={data.dateOfBirth} className='form-control' id="" /> */}

              {/* or this */}
              <div className="col-lg-6">
               <div className="form-check">
                <input type="checkbox" name="recieveNewsLetters" id="newsletter"
                className = 'form-check'
                value='true'
                checked= {data.recieveNewsLetters === true? true:false}
                onChange={(e)=>{setdata({...data,[e.target.name]:e.target.value})}}
                />
                <label htmlFor="newsletters" className="form-check-inline" ><Recieve></Recieve></label>
               </div>
              </div>
            </div>

{/* newsletter end */}


          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
